import React, {useState} from 'react';
import {
  Button, StyleSheet, Text, View,
    ScrollView,
    Image,
    TouchableOpacity,
    Animated,
    FlatList, 
  Dimensions,
  Alert
} from 'react-native';



const RegisteredStores = function (props) {
    
    return (
        <ScrollView
        style={styles.horizentalList}
        >
            <View
            style={styles.item}
            >
               <Image
                    source={require('../../assets/icon.png')}
                    style={{
                        width: '95%', height: 200,
                        margin:'3%',
                    }}
                />  
            <Text>Stores listing...</Text>
                
              

            </View>
            
        </ScrollView>
        
    )
};

export default RegisteredStores;


const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    horizentalList: {
      flex: 1,
    //    flexDirection:'column',
        // backgroundColor: 'red',
      
      
    },
    item: {
      backgroundColor: '#4ae1fa',
    //    justifyContent: 'center',
    //   alignItems: 'center',
    //   textAlign:'center',
        margin: 5,
      
    }
  });
